script: |
  super -f tsv -I q9060.sql | sort > q9060.out

vector: true

inputs:
  - name: q9060.sql
    data: |
      SELECT ALL - + col0 + col1 / + - col1 + + col2 AS col0 FROM tab2 AS cor0 WHERE NOT + col1 * col1 / + ( + + 36 ) >= - - 74 * + + col2 + - 76;
  - name: tab2

outputs:
  - name: q9060.out
    data: |
      -18
      -24
      -25
